using CrystalOSAlpha.Graphics.Engine;
using System;
using System.IO;

namespace CrystalOSAlpha.System32
{
    public class Fonts
    {
        public static string CustomCharset = "!\"#$%&'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_`abcdefghijklmnopqrstuvwxyz{|}~";
        public static void RegisterFonts()
        {
            MemoryStream ArialCustomCharset16 = new MemoryStream(Convert.FromBase64String(""));
            BitFont.RegisterBitFont(new BitFontDescriptor(CustomCharset, ArialCustomCharset16, 16, "ArialCustomCharset16"));

            MemoryStream MicrosoftSansSerifCustomCharset24 = new MemoryStream(Convert.FromBase64String(""));
            BitFont.RegisterBitFont(new BitFontDescriptor(CustomCharset, MicrosoftSansSerifCustomCharset24, 24, "VerdanaCustomCharset24"));

            MemoryStream VerdanaCustomCharset32 = new MemoryStream(Convert.FromBase64String(""));
            BitFont.RegisterBitFont(new BitFontDescriptor(CustomCharset, VerdanaCustomCharset32, 32, "VerdanaCustomCharset32"));
        }
    }
}
